{
public: Talker() : Node("talker") { publisher_ = this->create_publisher<std_msgs::msg::String>("chatter", 10); timer_ = this->create_wall_timer( 500ms, std::bind(&Talker::timer_callback, this)); } private: void timer_callback() { auto message = std_msgs::msg::String(); message.data = "Hello, ROS2!"; publisher_->publish(message); RCLCPP_INFO(this->get_logger(), "Publishing: '%s'", message.data.c_str()); } rclcpp::Publisher<std_msgs::msg::String>::SharedPtr publisher_; rclcpp::TimerBase::SharedPtr timer_;
}; int main(int argc, char * argv[])
